import React from 'react';
import NewsCard from '../Components/NewsCard/NewsCard';

const NewsCards = ({ articles }) =>{
    return(
        <div>
            {articles.map((article, i)=>(
                <NewsCard />
            ))}
        </div>
    );
}

export default NewsCards;
